import React,{useState} from 'react'

function DeliveryTakeAway() {

  const[deliveryIsChecked,setDeliveryIsChecked] = useState(false);
  const[takeAwayIsChecked,setTakeAwayIsChecked] = useState(false);

    return (
        <div>
        <div className="container-fluid" style={{marginTop:"0px", fontSize:"20px"}} style={{textAlign:"center", fontFamily:"Postmates", height:"40px",lineHeight:"10rem"}}>
        <div>
        <div className="container">
        <div className="row">

          <div className="col-md-12">
            <h2 className="grid-title">Delivery Option</h2>
            <hr />
            <div class="checkbox">
              <label><input
              type="checkbox"
              className="icheck"
              name="deliveryType"
              checked={deliveryIsChecked}
              value="delivery"
              onChange={
                (e) => {
                  console.log(e.target.value);
                  setDeliveryIsChecked(e.target.checked);
                }
              }
              />
              Delivery
              </label>
            </div>
            <div className="checkbox1">
              <label><input
              type="checkbox"
               className="icheck"
               name="deliveryType"
               checked={takeAwayIsChecked}
               value="takeAway"
               id="check2"
              onChange={
                (e) => {
                  console.log(e.target.value);
                  setTakeAwayIsChecked(e.target.checked);
                }
              }
              />
              Take Away
              </label>
            </div>
            <div className="padding">
            </div>
            <div className="padding">
            </div>
          </div>
          </div>
          </div>
          </div>
          </div>
          </div>
    )
}

export default DeliveryTakeAway;
